import Bed from '@bgms/Bed.mp3';
import Experience from '@bgms/Experience.mp3';
import HomeWork from '@bgms/Home Work.mp3';
import LastTravel from '@bgms/Last Travel.mp3';
import LikeADream from '@bgms/Like a dream.mp3';
import Morning from '@bgms/Bed.mp3';
import NightInParis from '@bgms/Night In Paris.mp3';
import Nocturne from '@bgms/Nocturne Op.9-2_smooth jazz.mp3';
import SilverWaves from '@bgms/silver_waves.mp3';
import Slowmotion from '@bgms/slowmotion.mp3';

export const bgmArr = [
  Bed,
  Experience,
  HomeWork,
  LastTravel,
  LikeADream,
  Morning,
  NightInParis,
  Nocturne,
  SilverWaves,
  Slowmotion,
];
